import "./Heroimg3style.css";




import React from 'react'

const Heroimg3 = () => {
  return (
    <div className="hero-img3">
        <div className="header3">
            <h1 className="cnt">CONTACT US</h1>
            <p className="cnt">Arrange a visit in our city by filling the form below</p>
            </div>

    </div>
  )
}

export default Heroimg3
